import React from 'react';
import BookingForm from './components/bookingform';

const style = {
  mainContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
  },
}

function App() {

  return (
    <div>
      <img src="https://storage.googleapis.com/mixo-files/logos/1698925507587-cabRide-9o1z.svg" style={{height:"auto"}}></img>
      <h1 style={style.mainContainer}>Cab Booking System</h1>
      <div style={style.mainContainer}>

        <BookingForm />
      </div>
    </div>
  );
}

export default App;
